class Home extends StatefulWidget {
  const Home({Key? key}) : super(key: key);

  @override
  _HomeState createState() => _HomeState();
}
class _HomeState extends State<Home> {

 static List<String> nm =["Parth","Bhargav","Yash","Mihir","vraj","satyam"];
 static List url=['data:image/jpeg;base64,','data:image/jpeg;base64,','data:image/jpeg;base64,','data:image/jpeg;base64,','data:image/jpeg;base64,','data:image/jpeg;base64,'];
 final List<contactDetails> cd=List.generate(
     nm.length,
         (index)
     => contactDetails('${nm[index]}', '${url[index]}'));
  @override
  Widget build(BuildContext context) {
    return SafeArea(
        child: Scaffold(
          body :
          Stack(
              children:[
              Positioned
              (bottom: 50,
              right: 50,
              child: Container
                (
                  height: 40,
                  width: 40,
                  decoration: BoxDecoration(color: Colors.green,shape: BoxShape.circle),
                  child: Icon(Icons.message,color: Colors.white,))),

          Column(
            children: [
              appbar(),
              optionbar(),
              Expanded(
                  child: ListView.builder(
                      itemCount: cd.length,
                      itemBuilder: (context,index)
                  {
                    return  InkWell(
                      onTap: (){
                        Navigator.push(context,MaterialPageRoute(builder: (context)=>const chat()));
                      },
                      child: ListTile(
                        leading: CircleAvatar(
                        radius: 20,
                  backgroundImage: NetworkImage(cd[index].imageUrl)),
                  title: Text(cd[index].nm),
                  subtitle: Text("HI"),
                  trailing: Text(" a minute ago"),
                  ),
                    );
                  },)
           ),
          ],
        ),
        ],
          ),
    ),
    );
  }
}
